function ExpenseDate(pros) {
    var month = pros.date.toLocaleString('da-DK', { month: 'long' });
    var day = pros.date.toLocaleString('da-DK', { month: '2-digit' });
    var year = pros.date.getFullYear();
    return (
        <div>
            <div>{month}</div>
            <div>{year}</div>
            <div>{day}</div>
        </div>
    )
}



export default ExpenseDate;
